import React from 'react';
import CustomButton from '../components/Button.jsx';

function Login() {
  return (
    <div>
      <h1>Page de connexion</h1>
      <img src="/logo.png" alt="Logo de l'application" />
      <form>
        <div>
          <label htmlFor="username">Nom d'utilisateur :</label>
          <input type="text" id="username" name="username" />
        </div>
        <div>
          <label htmlFor="password">Mot de passe :</label>
          <input type="password" id="password" name="password" />
        </div>
        {/* Utiliser le composant CustomButton avec la prop variant définie sur "login" */}
        <CustomButton variant="login" />
      </form>
      {/* Ajoutez d'autres éléments comme un lien vers la récupération de mot de passe ou l'inscription si nécessaire */}
    </div>
  );
}

export default Login;
